        	    {
        	    	expectedTokenName = (char*)tokenNames[ex->expecting];
        	    }
        	    
        	    throw UnexpectedTokenException(GGE1201_UnexpectedToken, location, expectedTokenName/*, currentTokenName, currentTokenText*/);
        	    
